import React from 'react'
import * as s from "./Header.elements.js"
import frame from "../../img/frame.png"

export function Header() {
    return (
        <>
            <s.InfoSection></s.InfoSection>
                <s.HeaderText>
                    <s.Title><s.Spaceship>Spaceship</s.Spaceship><br/>News Portal</s.Title>
                    <s.Description>Welcome to the most innovative news platform that will let you stay informed about the high-technology world of spaceship.</s.Description>
                    <s.Button>Learn More</s.Button>
                </s.HeaderText>
                <s.DesktopImage src={frame} alt="Desktop image"/>

        </>
    )
};
